import React from "react";
import styled from "styled-components";

const Header = styled.div`
  width: 100%;
  border-bottom: solid 1px #dbdbdb;
`;
function Login() {
  return (
    <div>
      <Header></Header>
    </div>
  );
}

export default Login;
